import logo from './logo.svg';
import './App.css';
import './components/Header.css';
import './components/Technologies.css';
import './components/Table.css';
import Technologies from './components/Technologies';
import Header from './components/Header';
import Table from './components/Table';


const response = await fetch('https://dummyjson.com/users/1');
let data = await response.json();
//let dataParsed = JSON.parse(data);
// .then(res => res.json())
// .then(console.log);

let name = data.firstName;
console.log(data.firstName);
//document.getElementById('name').innerHTML = name;


const App = () => {
  return (
    <div className="mainInfo">
      <div className="headerInfo"><Header /></div>
      <div className="table"><Table /></div>
      <div className="techInfo"><Technologies /></div>
    </div>
  );

}

const Table1 = () => {
  return(
    <table>
        <tbody>
          <tr>
              <th>ФИО</th>
              <th>Возраст</th>
              <th>Пол</th>
              <th>Номер телефона</th>
              <th>Город проживания</th>
              <th>Улица проживания</th>
          </tr>
          <tr>
              <td>Петров И.И.</td>
              <td>18</td>
              <td>М</td>
              <td>89999999999</td>
              <td>Казань</td>
              <td>Лулумбы</td>
          </tr>
          <tr>
            <td><span id="name"></span></td>
          </tr>
        </tbody>
      </table>
  )
}

document.getElementById("name").innerHTML = '<h1>smth</h1>';

export default App;
